import './App.css';

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <p>
          Ironsight - Systems Analysis and Design
        </p>
      </header>
      <iframe className="Netdata" title="netdata" frameBorder="0" src="https://netdata.tylerharrison.dev/"></iframe>
    </div>
  );
}

export default App;
